export const SongEditor = (props) => {
  if(props.current){
    let tracks = props.current.data
    return <TrackSelector tracks={tracks} />
  } else {
    return "no parents"
  }
}

const TrackSelector = (props) => {
  let tracks = props.tracks.map(item => {
    return Object.keys(item)//.notes.length
  })

  return tracks
}
